ssion Forum</a> is an excellent place to start.</td>\n</div>]]></static-content>\n</root>','general','','','','2013-12-03 18:01:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-04 07:12:04'),('8aa482db-5dd2-427f-832f-03c3bf30b90d',24505,23545,22701,10157,10436,'Adam OpenUnderwriter','2013-12-08 19:12:09','2013-12-08 19:12:09',0,0,0,'/0/','23543',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"border-bottom: 1px solid #1D8412;margin-bottom:10px;\">\n	Welcome to OpenActuary</div>\n<p>\n	OpenActuary is an open source shared actuarial data repository. It provides facilities to allow actuarial information and reports to be built and shared both within an organisation and across organisations. Information from an organisation\'s internal systems is extracted, translated and loaded into OpenActuary\'s staging areas. Once validated, it is then loaded into a shared master database. Reports are authored and run against this data and extracts provided for further analysis by actuaries.</p>\n<p>\n	OpenActuary is part of the <a href=\"/welcome\">OpenUnderwriter</a> product suite.</p>\n<div style=\"border-bottom: 1px solid #1D8412;margin-bottom:10px;\">\n	Sample Users</div>\n<p>\n	This version of OpenActuary is setup with a number of sample users. OpenActuary is designed to serve the needs of a number of different types of users. The primary type of user might be considered to be the actuary, but the system also supports company executives, organisation administrators, as well as developers working on reporting and ETL. Each of these types of user has specific needs in terms of the functionality they access, so each receives a tailored experience. Also, each user is associated with a specific insurance company and this defines their access rights to data and reports.</p>\n<p>\n	The pilot defines two companies: Metropolitan Insurance and Star Insurance. For each of these companies it also defines a complete set of users. As well as these, there are also users defined for OpenActuary administrative roles of Report and ETL administrator and system administrator.</p>]]></static-content>\n</root>','general','','','','2013-12-03 18:02:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-08 19:12:09'),('0b1bf303-23ae-4d2a-a960-5ddf2c63e3dd',25064,23556,22701,10157,10436,'Adam OpenUnderwriter','2013-12-11 19:44:30','2013-12-11 19:44:30',0,0,0,'/0/','23554',2.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Login Strip</Title></root>','login-strip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div class=\"ou-icon-strip\" id=\"login-strip\" style=\"max-width:1594px\">\n	<div style=\"width: 1594px;\">\n		<div class=\"ou-icon-strip-section\">\n			<div style=\"text-align:center\">\n				OpenActuary Users</div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'adam\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Adam</div>\n				<div class=\'ou-title\'>Administrator</div>\n				</a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'emily\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_female_profile.jpeg/cb03bb39-18fc-49d4-85d3-8d1f157b6acc?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Emily</div>\n				<div class=\'ou-title\'>ETL<br/>Administrator</div>\n				</a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'james\')\"> <img alt