s=\"ou-icon-strip-section\">\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenQuote+h480px.png/1225365c-6355-46ff-9b5a-c329b61164ef?t=1386091421000)\">\n				<a href=\"/en_GB/web/oq\" style=\"display: block; width: 180px; height: 180px\">\n					<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenQuote+h50px.png/2f1b1b49-8e83-44d1-9ee3-301e43b7a11c?t=1386091417000\" style=\"width: 151px; height: 28px; margin: 8px;\" /><br />\n					<p>Policy distribution tool allowing insurance products to be built and sold online. Includes rating and premium transactions.</p>\n					<p style=\"color:#f00\">Released</p>\n				</a>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenActuary+h480px.png/a3eaab6d-a89a-4240-b29e-e8c9448a8c66?t=1386091421000\">\n				<a href=\"/en_GB/web/oa\" style=\"display: block; width: 180px; height: 180px\">\n					<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenActuary+h50px.png/0a8dfe4a-0032-4ec4-9acb-292960329cb4?t=1386091416000\" style=\"width: 173px; height: 28px; margin: 8px;\" /><br />\n					<p>Actuarial research data repository. Provides import, export and reporting support for industry and insurer analysis.</p>\n					<p style=\"color:#f00\">In pilot</p>\n				</a>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenPolicy+h480px.png/baf5424e-14fd-40bd-a68b-cf501c29948d?t=1386091421000)\">\n				<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenPolicy+h50px.png/dd9f863e-cea8-4a13-816e-3a16968a59a7?t=1386091417000\" style=\"width: 151px; height: 28px; margin: 8px;\" /><br />\n				<p>Full policy life-cycle support. Products are extended to cover mid term adjustment, renewal and cancellation transactions.</p>\n				<p style=\"color:#f00\">In development</p>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenClaim+h480px.png/ba3f1b48-89c1-480a-ba43-be88ad9717a4?t=1386091421000)\">\n				<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenClaim+h50px.png/28da20cf-92f3-415a-9b84-24503cece488?t=1386091416000\" style=\"width: 147px; height: 28px; margin: 8px;\" /><br />\n				<p>A Claims management tool. Provides support for claims processes from first notification through to payment.</p>\n				<p style=\"color:#f00\">Concept</p>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	<br /><br.>\n	OpenUnderwriter is distributed under the <a href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU General Public License</a>. This means you can download it and use it freely without charge as long as you comply with the license. <a href=\"http://www.appliedindustriallogic.com\" target=\"_blank\">Applied Industrial Logic</a> - the original developers of OpenUnderwriter - offer comprehensive commercial support and consultancy services should you require them. Details, including how to contact us, can be found in the <a href=\"http://www.appliedindustriallogic.com/services/services-overview\" target=\"_blank\">Services</a> section of our website.</p>]]></static-content>\n</root>','general','','','','2013-12-03 17:59:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-11 20:47:52'),('f5b9b65c-be22-43af-9692-2f6d1ce3cbe7',25211,23510,10184,10157,10436,'Adam OpenUnderwriter','2013-12-11 22:01:15','2013-12-11 22:01:15',0,0,0,'/0/','23508',2.5,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welco-1','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p>\n	Welcome to OpenUnderwrite