one of his works had appropriate levels of life insurance. He created the Life Plus product to meet this need and in so doing made his workers very grateful indeed.</p>\n<p>\n	Jacob died in 1878 but by this time Life Plus was well known and respected among the mill owners and workers of Covershire for offering very competitive leves of cover for extreemly reasonable premiums. His son, Homer Section took over the business and saw it grow throughout his life time. Following his marrage to Constants Policy the business diversified to also offer Homer and Constants insurance, but following the 1882 chip pan crisis this side of the business was sold.</p>\n<p>\n	The solid principals upon which Jacob founded the business remain our core values today. Our mission statement \"We sell life insurance\" captures the mood and drive of the organisation prefectly.</p>\n<p>\n	Over the years, life plus has won many awards for innovation and excellence, including biggest pancake of the year at the 1932 Covershire fair.</p>]]></static-content>\n</root>','general','','','','2014-01-19 21:22:00',NULL,NULL,1,0,28529,'',0,28247,'Adam OpenUnderwriter','2014-01-19 21:22:14'),('0ce08432-4258-4d05-80fb-ffd2ba641ce2',28701,28518,11240,11214,28247,'Adam OpenUnderwriter','2014-01-19 21:36:33','2014-01-19 21:36:33',0,0,0,'/0/','28516',1.3,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">About Life Plus</Title></root>','about-life-plus','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/11252/0/Question+Mark.png/210ed639-3a3a-4491-8beb-e2a64164fc90?t=1390167189570\" style=\"min-width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>What is Term Life insurance?</h1>\n\n			<p>Term life insurance&nbsp;or&nbsp;term assurance&nbsp;is&nbsp;<a href=\"http://en.wikipedia.org/wiki/Life_insurance\">life insurance</a>&nbsp;which provides coverage at a fixed rate of payments for a limited period of time, the relevant term. After that period expires coverage at the previous rate of premiums is no longer guaranteed and the client must either forgo coverage or potentially obtain further coverage with different payments and/or conditions. If the insured dies during the term, the death benefit will be paid to the&nbsp;<a href=\"http://en.wikipedia.org/wiki/Beneficiary\">beneficiary</a>. Term insurance is the most inexpensive way to purchase a substantial death benefit on a coverage amount per premium pound basis.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/11252/0/Question+Mark.png/210ed639-3a3a-4491-8beb-e2a64164fc90?t=1390167189570\" style=\"width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>Term Life? Whole Life? Universal Life? I\'m confused!?</h1>\n\n			<p>Term life insurance is the original form of life insurance&nbsp;and can be contrasted to&nbsp;<a href=\"http://en.wikipedia.org/wiki/Permanent_life_insurance\">permanent life insurance</a>&nbsp;such as&nbsp;<a href=\"http://en.wikipedia.org/wiki/Whole_life_insurance\">whole life</a>,&nbsp;<a href=\"http://en.wikipedia.org/wiki/Universal_life_insurance\">universal life</a>, and&nbsp;<a href=\"http://en.wikipedia.org/wiki/Variable_universal_life_insurance\">variable universal life</a>, which guarantee coverage at fixed premiums for the lifetime of the covered individual. Many permanent life insurance products also build a predetermined cash value over the life of the contract, available for later withdrawal by the client under specific conditions. However, on most cash value policies like Whole Life insurance, the only way to receive the \"savings\" is to cash out the policy. The beneficiaries receive the face value of the insurance but NEVER the cash value with Whole Life policies. Financial advisers generally advise buying term life insurance and investing the difference elsewhere.</p>\n\n			<p>Term insurance functions in a manner similar to most other types of insurance in that it satisfies claims against what is insured if the premiums are up to date and the contract has not expired, and does not expect a return of Premium dollars if no claims are filed. As an example, auto insurance will satisfy claims against the insured in the event of an accident and a home owner policy will satisfy claims against the home if it is damaged or destroyed by, for example, an earthquake or fire. Whether or not these events will occur is uncertain, and if the policy holder discontinues coverage because he has sold the insured car or home the insurance company will not refund the premium. This is purely risk protection.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/11252/0/Question+Mark.png/210ed639-3a3a-4491-8beb-e2a64164fc90?t=1390167189570\" style=\"width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>How can it be used?</h1>\n\n			<p>Because term life insurance is a pure death benefit, its primary use is to provide coverage of financial responsibilities, for the insured. Such responsibilities may include, but are not limited to, consumer debt, dependent care, college education for dependents, funeral costs, and mortgages. Term life insurance is generally chosen in favor of permanent life insurance because it is usually much less expensive (depending on the length of the term). Many financial advisors or other experts commonly recommend term life insurance as a means to cover potential expenses until such time that there are sufficient funds available from savings to protect those whom the insurance coverage was intended to protect. For exhttp://www.sxc.hu/profile/hisksample, an individual might choose to obtain a policy whose term expires near his or her retirement age based on the premise that, by the time the individual retires, he or she would have amassed sufficient funds in retirement savings to provide financial security for their dependents.</p>\n			</td>\n		</tr>\n		<tr align=\"right\">\n			<td>&nbsp;</td>\n			<td class=\"portlet-font-dim\"><font size=\"1\">Queston Mark image by&nbsp;<a href=\"http://www.sxc.hu/profile/hisks\">Kriss Szkurlatowski</a>. Under license from&nbsp;<a href=\"/portal/auth/portal/default/Product+Manager/www.sxc.hu\">www.sxc.hu</a><br />\n			Text source Wikipedia: <a href=\"/portal/auth/portal/default/Product+Manager/\">Term Life insurance</a></font></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>]]></static-content>\n</root>','general','','','','2014-01-19 21:21:00',NULL,NULL,1,0,0,'',0,28247,'Adam OpenUnderwriter','2014-01-19 21:36:33'),('1af11830-8cc3-4a9f-acac-8179cb60c5e0',29010,28538,11240,11214,28247,'Adam OpenUnderwriter','2014-01-20 08:02:24','2014-01-20 08:02:24',0,0,0,'/0/','28536',1.4,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Banner</Title></root>','banner','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<img alt=\"\" src=\"/documents/11252/0/Banner.png/8e6d352f-9a49-4150-9086-e457c9c12ec0?t=1390167656170\" style=\"width: 748px; height: 253px;\" />]]></static-content>\n</root>','general','','','','2014-01-19 21:22:00',NULL,NULL,1,0,0,'',0,28247,'Adam OpenUnderwriter','2014-01-20 08:02:24'),('259277f3-0e86-4247-8a9d-39c3cc524819',29202,28548,11240,11214,28247,'Adam OpenUnderwriter','2014-01-21 06:58:45','2014-01-21 06:58:45',0,0,0,'/0/','28546',1.3,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Life Plus Links</Title></root>','life-plus-links','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table bor