you only buy one term life product this year, make it Life Plus. You, your family and your descendants for several generations will thank you for it.</em>\"<strong>- Jimbo Greenshirt</strong></p>\n			</td>\n			<td align=\"center\">&nbsp;<img alt=\"\" src=\"/documents/11252/0/Jimbo+Greenshirt.png/8339056e-97f9-4d59-83aa-f664e0bcf5c6?t=1390167627076\" /></td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-01-19 21:23:00',NULL,NULL,1,0,0,'',0,28247,'Adam OpenUnderwriter','2014-01-21 07:09:34'),('88274601-5eae-40e6-8955-4a8b3e03549a',29622,23567,22705,10157,10436,'Adam OpenUnderwriter','2014-01-21 17:35:20','2014-01-21 17:35:20',0,0,0,'/0/','23565',3.3,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">Welcome\n	to OpenQuote</div>\n\n<p>OpenQuote is the Open Source solution for providing insurance\n	quotations over the web. Using a web interface, insurance companies can\n	define any number of products or schemes to support any line of\n	business. These can then be made instantly available for quotation to\n	any proposer or other insurance intermediary who has web access.</p>\n\n<p>\n	OpenQuote is Open Source; distributed under the <a\n		href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU\n		General Public License</a>. This means you can download it and use it\n	freely without charge - as long as you comply with that license. Free\n	community support for OpenUnderwriter is available via our <a\n		href=\"http://www.openunderwriter.com/index.php/support/community\">support\n		forum</a>, which compliments our wider <a\n		href=\"http://www.openunderwriter.com/index.php/support/support-options\">commercial\n		support and value added service offerings</a>. For more information please\n	<a href=\"http://www.openunderwriter.com/index.php/contact\">contact\n		us</a>.\n</p>\n\n<p>\n	OpenQuote is part of the <a href=\"/welcome\">OpenUnderwriter</a> product\n	suite.\n</p>\n&nbsp;\n\n<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">Try\n	a sample product</div>\n\n<p>OpenQuote comes with a number of pre-built sample products to\n	give a feel for its capabilities. You can get try these right now by\n	clicking the links below. The full product definitions and all of the\n	supporting resources are also included and can be found in the Product\n	Manager (see below).</p>\n\n<div class=\"ou-icon-strip\" id=\"product-strip\" style=\"max-width: 1450px;\">\n	<div style=\"width: 1450px; min-height: 340px\">\n		<div class=\"ou-icon-strip-section\">\n			<div class=\"ou-icon-strip-icon\" style=\"width: 250px; height: 290px;\">\n				<a href=\"http://lifeplus.localhost:8080\"\n					style=\"display: block; width: 250px;\"> <img alt=\"\"\n					src=\"/documents/22705/0/LifePlusThumb.png/83f31829-2b57-4334-bb49-8a5db95fd688?t=1390311568000\"\n					style=\"width: 226px; height: 169px;\" />\n					<div class=\'ou-title\'>\n						<b>LifePlus</b>\n					</div>\n					<div class=\'ou-title\'>A simple product based on Term Life.\n						This is a good place to start learning the concepts of OpenQuote.</div>\n				</a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\" style=\"width: 250px; height: 290px;\">\n				<a href=\"http://irishbrokerpi.localhost:8080\"\n					style=\"display: block; width: 250px;\"><img alt=\"\"\n					src=\"/documents/22705/0/IrishBrokerPIThumb.png/61e44084-8b78-43b1-8e84-aac404ee8cda?t=1386092330000\"\n					style=\"width: 226px; height: 177px;\" />\n					<div class=\"ou-title\">\n						<b>Irish Broker PI</b>\n					</div>\n					<div class=\"ou-title\">\n						A product built in conjunction with City Net a London City broker.\n						Most of the portal is open access, but to see the quotation tab\n						you will need to login as <strong>broker</strong> (password also\n						\'broker\').\n					</div> </a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\" style=\"width: 250px; height: 290px;\">\n				<a href=\"http://motorplus.localhost:8080\"\n					style=\"display: block; width: 250px;\"><img alt=\"\"\n					src=\"/documents/22705/0/MotorPlusThumb.png/0183f87e-e7fe-4a32-a9e7-ed69148720ca?t=1386092331000\"\n					style=\"width: 226px; height: 168px;\" />\n					<div class=\"ou-title\">\n						<b>MotorPlus</b>\n					</div>\n					<div class=\"ou-title\">A reasonably complex personal motor\n						product. Offers support for multiple drivers and multiple vehicles\n						with four pages of rating questions in total.</div>\n				</a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\" style=\"width: 250px; height: 290px;\">\n				<a href=\"http://equineplus.localhost:8080\"\n					style=\"display: block; width: 250px;\"><img alt=\"\"\n					src=\"/documents/22705/0/EquinePlusThumb.png/8556793d-ced9-455e-95e0-7dc8d2885cab?t=1386092325000\"\n					style=\"width: 226px; height: 169px;\" />\n					<div class=\"ou-title\">\n						<b>EquinePlus</b>\n					</div>\n					<div class=\"ou-title\">\n						Private horse insurance\n						product offering cover for riding equipment and the horse.\n					</div>\n				</a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\" style=\"width: 250px; height: 290px;\">\n				<a href=\"http://freightplus.localhost:8080\"\n					style=\"display: block; width: 250px;\"><img alt=\"\"\n					src=\"/documents/22705/0/FreightPlusThumb.png/089d1e78-5fbf-4045-977c-e58755c4e41b?t=1386092329000\"\n					style=\"width: 226px; height: 155px;\" />\n					<div class=\"ou-title\">\n						<b>FreightPlus</b>\n					</div>\n					<div class=\"ou-title\">\n						A personal freight\n						shipping product. This product quotes based on just four question.\n					</div>\n				</a>\n			</div>\n		</div>\n	</div>\n</div>\n&nbsp;\n\n<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">Sample\n	Users</div>\n\n<p>The default installation of OpenQuote includes a number of sample\n	users to help demonstrate its features. You can login with these users\n	from the Quick Demo Sign In portlet to the right. This gives you access\n	to two types of user:</p>\n\n<ul>\n	<li>\n		<p>\n			As a <b>Product Developer</b> you can modify any feature of a product\n			or create completely new products. Two Product Manager are defined,\n			one for each of the demonstration organisations: Metropolitan\n			Insurance and Star Insurance. Each user has permission to edit their\n			organisation\'s products.\n		</p>\n	</li>\n	<li>\n		<p>\n			As a <b>Product Administrator</b> You can perform all of the\n			functions of a Product Developer, but have additional privileges and\n			administrative responsibilities.\n		</p>\n	</li>\n	<li>\n		<p>\n			As an <b>Administrator</b> you have complete access to the internals\n			of the system. You can add/remove users, administer windows, pages,\n			or even create completely new portals.\n		</p>\n	</li>\n</ul>]]></static-content>\n</root>','general','','','','2013-12-03 18:04:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-01-21 17:35:20'),('20395777-ad62-458a-ad48-8a519e88362d',30052,30053,12179,12153,28184,'Adam OpenUnderwriter','2014-01-22 07:22:51','2014-01-22 07:22:51',0,0,0,'/0/','30051',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Contacts</Title></root>','contacts','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p>\n	<strong><u>Ut tellus dolor dapibus</u></strong><br />\n	Auris ferment laoreet aliquam leo. Ut tellus dolor dapibus eget elementum vel cursus leifend, elit. Auris ferment laoreet aliquam leo. Ut tellus dolor dapibus eget elementum vel, cursus leifend, elit. Denean auctor wisi 