nal indemnity product available in the market today especially designed for insurance brokers based in Ireland.</p>\n</div>\n</div>\n</div>]]></static-content>\n</root>','general','','','','2014-01-22 07:21:00',NULL,NULL,1,0,0,'',0,28184,'Adam OpenUnderwriter','2014-01-22 21:07:11'),('70588f8c-7c47-457b-8a51-a0e94b7e0ff9',30328,30043,12179,12153,28184,'Adam OpenUnderwriter','2014-01-22 21:21:33','2014-01-22 21:21:33',0,0,0,'/0/','30041',1.6,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Broker Login Tip</Title></root>','broker-login-tip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"background-color:#FFA;padding:4px\">This site only allows registered brokers to perform quotations. To access the quotation page in this demo,&nbsp;login as <strong>broker@openunderwriter.org</strong> with the password <strong>broker</strong>.</div>]]></static-content>\n</root>','general','','','','2014-01-22 07:22:00',NULL,NULL,1,0,0,'',0,28184,'Adam OpenUnderwriter','2014-01-22 21:21:33'),('e8d1cacb-2630-4135-a4ba-33029a09694d',30362,30063,12179,12153,28184,'Adam OpenUnderwriter','2014-01-22 21:36:00','2014-01-22 21:36:00',0,0,0,'/0/','30061',1.3,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Main Menu</Title></root>','main-menu','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\">\n	<tbody>\n		<tr>\n			<td><a href=\"/web/guest/home\">WELCOME</a></td>\n			<td>Home page and news.</td>\n		</tr>\n		<tr>\n			<td><a href=\"/web/guest/products\">PRODUCTS</a></td>\n			<td>The products that we offer.</td>\n		</tr>\n		<tr>\n			<td><a href=\"/web/guest/contacts\">CONTACTS</a></td>\n			<td>How to get in contact with us.</td>\n		</tr>\n		<tr>\n			<td><a href=\"/web/guest/services\">SERVICES</a></td>\n			<td>Our services and commitments.</td>\n		</tr>\n		<tr>\n			<td><a href=\"/web/guest/quotation\">QUOTATION</a></td>\n			<td>For registered users only.</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-01-22 07:22:00',NULL,NULL,1,0,0,'',0,28184,'Adam OpenUnderwriter','2014-01-22 21:36:00'),('9cf15d89-3095-46be-9092-8e79ab631008',30366,30073,12179,12153,28184,'Adam OpenUnderwriter','2014-01-22 21:40:46','2014-01-22 21:40:46',0,0,0,'/0/','30071',1.9,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">News</Title></root>','news','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\">\n	<tbody>\n		<tr>\n			<td valign=\"top\" width=\"50%\">\n			<table border=\"0\">\n				<tbody>\n					<tr>\n						<td valign=\"top\" width=\"128px\"><img alt=\"\" src=\"/documents/12179/0/clock.png/985823d1-9ad8-4afe-ba2b-9cbfb280ac2c?t=1390375235513\" style=\"height: 85px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone\'s Claim turn around times best in sector</strong>. A report by the OIF shows Bluestones claims handling to be the best in the PI sector, a full 25% more responsive than it\'s next leading competitor.</td>\n					</tr>\n					<tr>\n						<td colspan=\"2\">&nbsp;</td>\n					</tr>\n					<tr>\n						<td valign=\"top\"><img alt=\"\" src=\"/documents/12179/0/office+people.png/2f07c2f7-cffa-4a71-a031-d554c928da87?t=1390375209549\" style=\"height: 98px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone announces the opening of a new regional office.</strong> Bluestone has opened its third regional office. The new Dublin office opened last month joining Cork and Limerick to bring Irish Broker PI to more areas.</td>\n					</tr>\n				</tbody>\n			</table>\n\n			<p>&nbsp;</p>\n			</td>\n			<td valign=\"top\" width=\"50%\">\n			<table border=\"0\">\n				<tbody>\n					<tr>\n						<td valign=\"top \" width=\"128px\"><img alt=\"\" src=\"/documents/12179/0/hand+shake.png/77346946-363b-4621-8878-fa22d66d729a?t=1390375978438\" style=\"height: 143px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone welcomes more new policy holders.</strong> Over the last year we are pleased to say that we have seen a 63% increase in new business take up over the previous year.</td>\n					</tr>\n					<tr>\n						<td colspan=\"2\">&nbsp;</td>\n					</tr>\n					<tr>\n						<td valign=\"top\"><img alt=\"\" src=\"/documents/12179/0/laptop.png/3a5d43ae-7164-4a76-a8d3-1b371c047f26?t=1390375209228\" style=\"height: 150px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Less paper work, and less red tape.</strong> Bluestone announced their online claims handling site today. This greatly simplifies the processing of claims and enables us to make payments faster than ever before.</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-01-22 07:23:00',NULL,NULL,1,0,0,'',0,28184,'Adam OpenUnderwriter','2014-01-22 21:40:46');
